import { HttpAuth } from '../../config/Http';
import { changeLoading } from './loading.action';

export const index = () => dispatch => {
  HttpAuth.get('/item')
    .then( (response) => {
      dispatch({
        type: 'INDEX',
        response
      })
    })}
